;; **
;;; ## Data
;; **

;; @@
(require 'htm-mnist.core :reload)

(defn pprint-imgdata
  [bytes]
  (binding [*print-right-margin* 80]
    (->> bytes
         (map #(if (< % 32) '_ 'X))
         (partition 28 28)
         (pprint))))

(defn mnist-inputs
  [images-file labels-file xform n]
  (map (fn [img lab]
         {:image (xform img)
          :label lab})
       (this/read-mnist-images images-file n)
       (this/read-mnist-labels labels-file)))

(defn fg-indices
  [image]
  (keep-indexed (fn [i pixval]
                  (when (>= pixval 64) i))
                image))

(defn train-inputs
  [xform n]
  (mnist-inputs "public/data/train-images-idx3-ubyte"
                "public/data/train-labels-idx1-ubyte.gz"
                xform n))

(defn test-inputs
  [n]
  )

(->> (train-inputs identity 8)
     (last)
     :image
     (pprint-imgdata))

